pub fn main() {
    let mut seed: Seed;

    seed = get_info();

    if let Some(x) = pre_calc(seed) {
        let cs = x
            .as_bytes()
            .chunks(PRINT_SIZE)
            .map(from_utf8)
            .collect::<Result<Vec<&str>, _>>()
            .unwrap();

        for s in cs {
            println!("{}", s);
            seed = get_info();
        }
    }

    loop {
        let m = ['U', 'D', 'L', 'R'];
        println!("{}", m[seed as usize % 4]);
        seed = get_info();
    }
}
